import React from "react";
import { useRef, useState, useEffect } from "react";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import 'font-awesome/css/font-awesome.min.css';
import '../../styling/Map.css';

function Map() {

    const [zoomValue, setZoomValue] = useState(100);
    const [isZoomInDisabled, setIsZoomInDisabled] = useState(false);
    const [isZoomOutDisabled, setIsZoomOutDisabled] = useState(true);
    const [zoomOutputValue, setZoomOutputValue] = useState("100%");
    const [leftPanel, setLeftPanel] = useState("-30em");
    //Data Outputs

    const [countryNameOutput, setCountryNameOutput] = useState("");
    const [countryFlagOutput, setCountryFlagOutput] = useState("./flag.png");
    const [cityOutput, setCityOutput] = useState("");
    const [newsOutput, setNewsOutput] = useState("");


    const mapReference = useRef();

    function handleZoomIn() {

        setIsZoomOutDisabled(false);
        setZoomValue(prevZoomValue => {
            const newZoomValue = prevZoomValue + 100;
            return newZoomValue;
        });        

        if(zoomValue >= 400) {
            setIsZoomInDisabled(true);
        }
    }

    function handleZoomOut() {
        setIsZoomInDisabled(false);

        setZoomValue(prevZoomValue => {
            const newZoomValue = prevZoomValue - 100;
            return newZoomValue;
        })

        if(zoomValue <= 200) {
            setIsZoomOutDisabled(true);
        }

    }

    useEffect(() => {
        mapReference.current.style.width = zoomValue + "vw";
        mapReference.current.style.height = zoomValue + "vh";
        setZoomOutputValue(zoomValue + "%");
    }, [zoomValue]);

    function handleMouseEnter(value) {
        const classes = value.className.baseVal;
        const selector = "."+ classes.split(' ').join('.');
        console.log(selector);
        if (selector !== ".") {
            const allAreas = document.querySelectorAll(selector);
            allAreas.forEach(el => el.style.fill = "#c99aff");
        }
    }

    function handleMouseLeave(value) {
        const classes = value.className.baseVal;
        const selector = "."+ classes.split(' ').join('.');
        console.log(selector);
        if (selector !== ".") {
            const allAreas = document.querySelectorAll(selector);
            allAreas.forEach(el => el.style.fill = "#443d4b");
        }
    }



    function handleClick(value) {
        let clickedCountryName;
        if(!value.getAttribute("name")) {
            clickedCountryName = value.className.baseVal;
        } else {
            clickedCountryName = value.getAttribute("name");
        }
        console.log(clickedCountryName);
        setLeftPanel("0");

        fetch(`https://restcountries.com/v3.1/name/${clickedCountryName}?fullText=true`).then(response => {
            if(!response.ok) {
                throw new Error('Network response was not ok');
            } 
            return response.json();
        }).then(data => {
            console.log(data);

            setCountryNameOutput(data[0].name.common);
            setCountryFlagOutput(data[0].flags.png);
            setCityOutput(data[0].capital);
        });

        fetch("/" + clickedCountryName).then(response => {
            return response.text();
        }).then(data => {
            console.log(data);
            setNewsOutput(data);
        });

    } 

    function handleClosePanel() {
        setLeftPanel("-30em")
    }


    return (
    <>
        <div className="world-map">
            <div className='map-container'>


            </div>
        </div>

        <div className='side-panel' style={{left: leftPanel}}>
            <div className='container'>
                <p>News from today</p>
                <h1 className="country-name">{countryNameOutput}</h1>
                <img src = {countryFlagOutput} className="country-flag"></img>
                <ul>
                    <li>
                        <strong>Capital City:</strong>
                        <span className="city">{cityOutput}</span>
                    </li>
                </ul>

                <p className="news">
                    <b>Daily News:</b><br/>
                    {newsOutput}
                </p>
            </div>
            <button className="close-btn" onClick={handleClosePanel}>
            <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 384 512"><path d="M376.6 84.5c11.3-13.6 9.5-33.8-4.1-45.1s-33.8-9.5-45.1 4.1L192 206 56.6 43.5C45.3 29.9 25.1 28.1 11.5 39.4S-3.9 70.9 7.4 84.5L150.3 256 7.4 427.5c-11.3 13.6-9.5 33.8 4.1 45.1s33.8 9.5 45.1-4.1L192 306 327.4 468.5c11.3 13.6 31.5 15.4 45.1 4.1s15.4-31.5 4.1-45.1L233.7 256 376.6 84.5z"/></svg>
            </button>
        </div>
        <div className="zoom-controls">
            <button className="zoom-in" onClick={handleZoomIn} disabled={isZoomInDisabled}>+</button>
            <button className="zoom-out" onClick={handleZoomOut} disabled={isZoomOutDisabled}>-</button>
            <p className="zoom-value">{zoomOutputValue}</p>
        </div>
      </>
    );
  };

  export default Map;
